  {
    display: none !important;
  }

  #navbar-search-input,
    #navbar-search-btn
  {
    border: 1px solid pink;
        /*Search border color*/
    ;
  }

  body
  {
    background: pink !important;
  }

  .content
  {
    background: transparent !important;
  }

  .container-footer
  {
    position: static;
  }

  html,
    body
  {
    width: 100% !important;
    height: 100% !important;
    background-size: cover !important;
    background-attachment: fixed !important;
    background-image: url("data:image/jpeg;base64,") !important;
  }

  #party_none_title,
        div.friend_dock_chatbox_titlebar.chat-header-blink-off
  {
    background: linear-gradient(to bottom, #ffe3ec, #ffe3ec);
  }

  #ctl00_cphRoblox_RightColumn,
        #Body > table > tbody > tr > td:nth-child(3),
        #Body > table > tbody > tr > td:nth-child(4)
  {
    display: none;
  }

  #GamesPageLeftColumn
  {
    width: auto;
    margin-right: 10px !important;
    margin-left: 10px !important;
  }

  #GamesListsContainer > div
  {
    background-color: transparent !important;
    width: 100% !important;
  }
/* This is just to indicate this style was made by me, DittoDino aka BoopBop, and to find out who is gonna copy my code */
  #navigation
  {
    background-color: #332729;
  }

  .rbx-btn-primary-lg
  {
    background-color: #332729;
  }

  .rbx-btn-primary-lg:hover,
        .rbx-btn-primary-lg:focus
  {
    background-color: #332729;
  }

  .avatar-back
