    background-image: url(https://i.pinimg.com/564x/32/ee/4b/32ee4bfdb92d298d26f1e5e4890132e8.jpg);
  }

  .notification-blue
  {
    background-color: #332729;
  }

  body
  {
    background-color: #332729;
    color: black !important;
    font-family: serif;
    font-weight: 300;
    font-size: 16px;
    width: 100%;
    height: 100%;
    min-width: 320px;
    margin-bottom: 168px;
    overflow-y: scroll;
  }

  .dialog-container .dialog-message-container .dialog-message
  {
    background-color: #332729;
    border: 1px solid #332729;
    color: #332729;
  }

  .dialog-container .dialog-header
  {
    background-color: #332729;
    color: #332729;
  }

  .chat-windows-header
  {
    background-color: #332729;
    color: #332729;
  }

