        .dialog-container .dialog-message-container.message-cluster-master .dialog-triangle:before /* This is just to indicate this style was made by me, DittoDino aka BoopBop, and to find out who is gonna copy my code */
  {
    border-color: transparent transparent transparent #332729;
  }

  .section-content
  {
    background-color: #ffe3ec4d;
    padding: 15px;
    position: relative;
  }

  .game-card-container
  {
    background-color: #ffe3ec4d;
    position: relative;
    border-radius: 3px;
    float: left;
    height: 100%;
    margin: 0 auto;
    padding: 0;
    text-align: left;
    width: 100%;
  }

  .gotham-font .btn-to-link,
